import './App.css';

function App() {
  return (
    <div className='container-fluid'>
     <container>
      <Grid container xs={12}>
        <Grid item xs={6}>
          <Grid container>
            <Grid item>
              corono count
            </Grid>
          </Grid>
        </Grid>
        <Grid item xs={6}>
          world
        </Grid>
      </Grid>
     </container>
    </div>
  );
}

export default App;
